import React from "react";
import styled from "styled-components";
const Wrapper = styled.div`
  width: 100%;
  height: 60px;
  border-radius: 10px;
  border: solid 1px #dbdbdb;
`;
function Agree() {
  return <Wrapper></Wrapper>;
}

export default Agree;
